webpackJsonp([5],{Q6Di:function(module,exports){module.exports="1\xa0\xa0\xa0\xa0\xa0\xa0\xa0\n\n00:05\xa0\n\nHello {{name}}\n\n2\xa0\xa0\xa0\xa0\xa0\xa0\n\n\xa000:07\xa0\n\nIf you\u2019ve made it here, then congratulations!\n\n3\n\n\xa000:10\xa0\n\nBecause this means that your archetype is the Magician!\n\n{{#displayImage}} {path:'images/archetype-icons/magician.png', fadeIn: true} {{/displayImage}}\n\n4\n\n\xa000:14\xa0\n\nBut what does this actually mean?\n\n5\n\n\xa000:17\xa0\n\nDon\u2019t worry, everything you need to know will be on this page.\n\n6\n\n\xa000:21\xa0\n\nStick to the end of it and I promise that you\u2019ll experience something truly magical.\n\n{{#displayImage}} {path:'images/archetype-icons/magician.png', fadeOut: true} {{/displayImage}}\n\n7\n\n\xa000:27\xa0\n\nThe quiz that you\u2019ve just taken is designed to identify your archetype\u2026\n\n8\n\n\xa000:32\xa0\n\nA personality profile that\u2019s broken down your entire being.\n\n9\n\n\xa000:36\xa0\n\nYour tendencies, your strengths, your past, and your future.\n\n10\n\n\xa000:42\xa0\n\nYour archetype takes into account your gender, your marital status\u2026\n\n11\n\n\xa000:47\xa0\n\nHow you answered the quiz, and how long you took to get those answers.\n\n12\n\n\xa000:51\xa0\n\nThat\u2019s right, {{name}}.\n\n13\n\n\xa000:54\xa0\n\nYou can use that information to make astronomical changes in your life.\n\n14\n\n\xa000:58\xa0\n\nYou\u2019ll be able to leverage on your strengths, improve on your weaknesses\u2026\n\n15\n\n\xa001:03\xa0\n\nAnd embark on the life that you\u2019ve always dreamed of.\n\n16\n\n\xa001:06\xa0\n\nBut before we get into that, I want to share with you about your archetype\u2026\n\n17\n\n\xa001:11\xa0\n\nThe Magician, and what it means.\n\n18\n\n\xa001:13\xa0\n\n{{name}}, you truly are a unique individual.\n\n19\n\n\xa001:17\xa0\n\nAnd I genuinely believe that this world needs more people like you.\n\n20\n\n\xa001:21\xa0\n\nYou are an intellectual and deeply spiritual being\u2026\n\n21\n\n\xa001:25\xa0\n\nNot necessarily in the sense of religion, but in terms of your understanding of the universe.\n\n22\n\n\xa001:30\xa0\n\nYou\u2019re different that way, {{name}}.\n\n23\n\n\xa001:33\xa0\n\nWhile the world walks in one direction, you have no qualms with going against it.\n\n24\n\n\xa001:38\xa0\n\nThat\u2019s what makes you so special, {{name}}.\n\n25\n\n\xa001:42\xa0\n\nYou have a profound understanding when it comes to the inner-workings of human beings.\n\n26\n\n\xa001:48\xa0\n\nYou\u2019re able to empathize with anyone and everyone\u2026\n\n27\n\n01:51\xa0\n\nAnd you\u2019re able to discern what people really want.\n\n28\n\n\xa001:54\xa0\n\nThat\u2019s because as a Magician\u2026\n\n29\n\n\xa001:56\xa0\n\nYou are able to recognize the most intricate details about people.\n\n30\n\n\xa002:00\xa0\n\nYou are constantly on the search for knowledge that will help you improve as an individual.\n\n31\n\n\xa002:05\xa0\n\n{{name}}, you might not know it yet\u2026\n\n32\n\n\xa002:08\xa0\n\nBut you are an innately talented individual and an excellent all-rounder.\n\n33\n\n\xa002:13\xa0\n\nYou are a capable individual who\u2019s able to wear many different hats\u2026\n\n34\n\n\xa002:17\xa0\n\nSort of like an actual magician who has many tricks hidden in his sleeves.\n\n35\n\n\xa002:21\xa0\n\nThere is something else about you, {{name}}\u2026\n\n{{#displayImage}} {path:'images/script-images/globe.png', fadeIn: true} {{/displayImage}}\n\n36\n\n\xa002:24\xa0\n\nYou are a visionary who has the capacity to bring real change to the world.\n\n37\n\n\xa002:29\xa0\n\n{{name}}, I\u2019m getting the sense that you\u2019re going to live a long, and happy life.\n\n38\n\n\xa002:33\xa0\n\nAnd although success might not be at your feet right now\u2026\n\n39\n\n\xa002:37\xa0\n\nYour riches and fulfilment are merely waiting for you.\n\n{{#displayImage}} {path:'images/script-images/globe.png', fadeOut: true} {{/displayImage}}\n\n40\n\n\xa002:40\xa0\n\nBut there\u2019s something else, {{name}}.\n\n41\n\n\xa002:43\xa0\n\nEven though you will triumph, your path to success will not come easy.\n\n42\n\n\xa002:48\xa0\n\nAs a Magician, your biggest challenge lies within how critical you are of people.\n\n43\n\n\xa002:53\xa0\n\nThis applies to your expectations of both others and yourself.\n\n44\n\n\xa002:57\xa0\n\nI\u2019m sensing that you tend to struggle with disappointment.\n\n45\n\n\xa003:01\xa0\n\nPeople seem to constantly let you down, and more often than not\u2026\n\n46\n\n\xa003:05\xa0\n\nYou feel as if you never seem to be able to meet the expectations that you\u2019ve set for yourself.\n\n47\n\n\xa003:10\xa0\n\n{{name}}, don\u2019t let that discourage you.\n\n48\n\n\xa003:13\xa0\n\nThe world needs your talents and unique abilities.\n\n49\n\n\xa003:16\xa0\n\nThe world needs people like you to be in positions of power.\n\n50\n\n\xa003:20\xa0\n\nYou are what keeps the world functioning.\n\n51\n\n\xa003:22\xa0\n\nYou bring change and improvement into the world.\n\n52\n\n\xa003:25\xa0\n\nYou do, however, need to understand that it\u2019s important for you to be\u2026\n\n53\n\n\xa003:29\xa0\n\nLess closed off and more connected with others.\n\n54\n\n\xa003:32\xa0\n\nThere is no doubt that people have a great amount of respect for you\u2026\n\n55\n\n\xa003:35\xa0\n\nBut at times you can appear aloof and difficult to speak with.\n\n56\n\n\xa003:39\xa0\n\nThat way, you\u2019ll be able to build trust and create even more fruitful interactions.\n\n57\n\n\xa003:43\xa0\n\nAfter all, {{name}}, conversation might not be your forte.\n\n58\n\n\xa003:48\xa0\n\nBut mastering the art of conversation will eventually create opportunities for you.\n\n59\n\n\xa003:52\xa0\n\n{{name}}, I can already tell that your friends and family really look up to you.\n\n60\n\n\xa003:58\xa0\n\nYou\u2019re the one who they come to for detailed advice, a listening ear, or just a quick chat.\n\n61\n\n\xa004:03\xa0\n\nYou\u2019re not the type of person to have huge circles of friends.\n\n62\n\n\xa004:08\xa0\n\nYou\u2019re not someone who has trouble with making friends.\n\n63\n\n\xa004:11\xa0\n\nIn fact, you have no trouble at all when it comes to\u2026\n\n64\n\n04:14\xa0\n\nImpressing others with your intelligence and sweet nature.\n\n65\n\n\xa004:17\xa0\n\nBut you\u2019re extremely selective with who you choose to let into your life.\n\n66\n\n\xa004:21\xa0\n\nYou prefer to keep your loved ones close, and your wolf pack small.\n\n67\n\n\xa004:25\xa0\n\n{{name}}, you are incredibly nurturing.\n\n68\n\n\xa004:29\xa0\n\nYou possess the unique ability to connect with others and blend into any social group.\n\n69\n\n\xa004:35\xa0\n\nYou have a great deal to offer to this world.\n\n70\n\n\xa004:38\xa0\n\n{{name}}, you are a natural-born problem-solver.\n\n71\n\n\xa004:41\xa0\n\nI sense that you will find success and fulfilment as\u2026\n\n72\n\n04:44\xa0\n\nAn entrepreneur, a manager, a journalist or a professor.\n\n73\n\n\xa004:48\xa0\n\nYou can be very protective, {{name}}.\n\n74\n\n\xa004:51\xa0\n\nEspecially as a parent.\n\n75\n\n\xa004:52\xa0\n\nYou love your children, friends, and family fiercely.\n\n76\n\n\xa004:56\xa0\n\nYou are willing to give and sacrifice everything that you have for them.\n\n77\n\n\xa005:00\xa0\n\n{{name}}, you are going to make a lasting mark in your lifetime.\n\n78\n\n\xa005:05\xa0\n\nYou\u2019re able to look at the world from a broad and altruistic perspective.\n\n79\n\n\xa005:09\xa0\n\nYou see the big picture, and you have what it takes to make this world more connected.\n\n80\n\n\xa005:13\xa0\n\n{{name}}, you are a fast learner.\n\n81\n\n\xa005:17\xa0\n\nWhile others seem to find it difficult to even understand the fundamentals of a new skill\u2026\n\n82\n\n\xa005:22\xa0\n\nYou\u2019re able to attain mastery over anything you set your mind to.\n\n83\n\n\xa005:25\xa0\n\nIn a way, your greatest strength is your ability to learn.\n\n84\n\n\xa005:29\xa0\n\nYou excel at one-on-one interactions\u2026\n\n85\n\n\xa005:32\xa0\n\nAnd never fail to make an excellent impression on others.\n\n86\n\n\xa005:35\xa0\n\nYour charisma and eloquence intrigues people.\n\n87\n\n\xa005:39\xa0\n\nUltimately, {{name}}, you are a realist.\n\n88\n\n\xa005:42\xa0\n\nYou have a clear conscience.\n\n89\n\n\xa005:44\xa0\n\nDiscerning right from wrong has never been a difficult task for you.\n\n90\n\n\xa005:48\xa0\n\nI\u2019m getting the sense that you\u2019re not too concerned about monetary riches\u2026\n\n91\n\n\xa005:52\xa0\n\nAlthough you do wish you had more wealth.\n\n92\n\n\xa005:55\xa0\n\nThere is, however, a greater purpose for you in this lifetime, {{name}}.\n\n93\n\n\xa005:59\xa0\n\nYou must also be aware of the relationships that you forge\u2026\n\n94\n\n06:02\xa0\n\nAnd prevent yourself from succumbing to the expectations of others.\n\n95\n\n\xa006:06\xa0\n\n{{name}}, you can at times depend on the approval of others for your own happiness.\n\n96\n\n06:11\xa0\n\nAnd that is something that you need to be careful of.\n\n97\n\n\xa006:14\xa0\n\nAt times, it might feel as if you\u2019re living your life for others.\n\n98\n\n\xa006:18\xa0\n\nThat\u2019s not what you want, {{name}}.\n\n99\n\n\xa006:20\xa0\n\nYou want to live life for yourself.\n\n100\n\n\xa006:23\xa0\n\nYou want to love yourself.\n\n101\n\n\xa006:25\xa0\n\nWhen you\u2019re able to do that, success and the life of your dreams will follow.\n\n102\n\n\xa006:30\xa0\n\nAnd that\u2019s what Individuation aims to teach you.\n\n103\n\n\xa006:34\xa0\n\nBut there\u2019s more to what I\u2019ve learned about you, {{name}}\u2026\n\n104\n\n\xa006:37\xa0\n\nIt feels to me that you\u2019re a deeply emotional and spiritual person.\n\n{{#displayImage}} {path:'images/script-images/spiritual.png', fadeIn: true} {{/displayImage}}\n\n105\n\n\xa006:42\xa0\n\nYou\u2019re connected to your soul in a way that\u2019s far more profound than others.\n\n106\n\n\xa006:46\xa0\n\nYour thought process does not follow the rules and logic of the world.\n\n107\n\n\xa006:51\xa0\n\nIn fact, I get the sense that you have quite the imagination.\n\n108\n\n\xa006:54\xa0\n\nYour thoughts and dreams are vivid, colourful\u2026\n\n109\n\n\xa006:57\xa0\n\nAnd symbolic of who you are as an individual.\n\n{{#displayImage}} {path:'images/script-images/spiritual.png', fadeOut: true} {{/displayImage}}\n\n110\n\n\xa007:00\xa0\n\n{{name}}, you\u2019re not someone who likes to argue.\n\n111\n\n\xa007:05\xa0\n\nYou tend to avoid conflict and you\u2019re uncanny when it comes to devising win-win situations.\n\n112\n\n\xa007:10\xa0\n\nBut when backed into a corner, you\u2019re not one to back down.\n\n113\n\n\xa007:14\xa0\n\nYou fight fiercely for your loved ones and for righteousness.\n\n114\n\n\xa007:18\xa0\n\nYou\u2019re the first person to step in when you see a fight breaking out.\n\n115\n\n\xa007:23\xa0\n\nYou\u2019re the first person to reach for your pockets in the sight of a struggling busker.\n\n116\n\n\xa007:27\xa0\n\nYou\u2019re the first person your friends call when they\u2019ve had a horrible day.\n\n117\n\n\xa007:31\xa0\n\nYou\u2019re the one who people rely on and look up to.\n\n118\n\n\xa007:35\xa0\n\n{{name}}, you are the role model of the world.\n\n119\n\n\xa007:37\xa0\n\nBut every magician needs a side-kick\u2026\n\n120\n\n\xa007:41\xa0\n\nA partner in crime who will stick by them when the going gets tough.\n\n{{#displayImage}} {path:'images/love-compatibility/magician-love-compatibility.png', fadeIn: true} {{/displayImage}}\n\n121\n\n\xa007:44\xa0\n\nThis little chart I\u2019ve prepared represents the archetypes that you\u2019re most likely to end up with.\n\n122\n\n\xa007:50\xa0\n\nOr if you\u2019re already in a committed relationship\u2026\n\n123\n\n\xa007:53\xa0\n\nThere\u2019s a really good chance that your spouse is one of those archetypes.\n\n124\n\n\xa007:56\xa0\n\n{{name}}, you\u2019re not the kind of person that has trouble when it comes to love.\n\n125\n\n\xa008:01\xa0\n\nPeople find themselves drawn to your charisma and kind nature.\n\n126\n\n\xa008:05\xa0\n\nYou\u2019re sort of a rare breed when it comes to love.\n\n127\n\n\xa008:08\xa0\n\nYou communicate better than anyone else, and you\u2019re an incredibly thoughtful individual.\n\n128\n\n\xa008:13\xa0\n\nThe relationships that you forge with potential lovers are always profound and deep.\n\n129\n\n\xa008:18\xa0\n\nYou become very selective with who you choose to date\u2026\n\n130\n\n\xa008:21\xa0\n\nAnd who you choose to end up with\u2026\n\n131\n\n\xa008:23\xa0\n\nFor good reason, of course.\n\n132\n\n\xa008:25\xa0\n\nI sense that in the coming years, you will be the happiest you\u2019ve ever been in that regard.\n\n133\n\n\xa008:30\xa0\n\n{{name}}, I\u2019m sensing that your love life isn\u2019t going to be the smoothest\u2026\n\n134\n\n\xa008:34\xa0\n\nBut you will find that happiness that you\u2019re looking for soon enough.\n\n{{#displayImage}} {path:'images/love-compatibility/magician-love-compatibility.png', fadeOut: true} {{/displayImage}}\n\n135\n\n\xa008:38\xa0\n\nBut don\u2019t forget, {{name}}\u2026\n\n136\n\n\xa008:40\xa0\n\nHow you perceive yourself should not be determined by your love life.\n\n137\n\n\xa008:45\xa0\n\nYour spouse or partner is meant to play a supporting role in your life\u2026\n\n138\n\n\xa008:48\xa0\n\nNot the lead.\n\n139\n\n\xa008:50\xa0\n\nFocus on your own personal growth, and I promise you, {{name}}\u2026\n\n140\n\n\xa008:54\xa0\n\nYou will soon discover heavenly rewards."}});
